import React from 'react'
import { Navigate, Outlet ,Route } from 'react-router'

const Protected=({auth})=> {
    return (
        <div>
            <Route {...rest} render={(props)=>{
                if(auth) return {Outlet}
                if(!auth) return <Navigate to="/" />
            }} />
        </div>
    );
  
}

export default Protected
